import React from "react";

const Button = ({ icon, caption, extraClass, extraStyle, onClick }) => {
  return (
    <button
      className={`${extraClass} r pt12 pb12 pl4 pr4`}
      style={extraStyle}
      onClick={onClick}
    >
      <span
        style={{ background: `url(${icon})`, height: "32px", width: "32px" }}
      ></span>
      <span>{caption}</span>
    </button>
  );
};

export default Button;
